import React from 'react'
import './FilterBox.css'
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import MenuItem from '@mui/material/MenuItem';
import Slider from '@mui/material/Slider';
import { Button } from './Button';

const propertyTypes = [
    {
      value: 'pt1',
      label: 'Casas',
    },
    {
      value: 'pt2',
      label: 'Condominios',
    },
    {
      value: 'pt3',
      label: 'Bodegas Industriales',
    },
    {
      value: 'pt4',
      label: 'Locales Comerciales',
    },
    {
        value: 'pt5',
        label: 'Fincas',
      },
      {
        value: 'pt6',
        label: 'Lotes',
      },
  ];

  const Bedrooms = [
    {
      value: 'b1',
      label: '1 cuarto',
    },
    {
      value: 'b2',
      label: '2 cuartos',
    },
    {
      value: 'b3',
      label: '3 cuartos',
    },
    {
      value: 'b4',
      label: '4 o m치s cuartos',
    },

  ];


const location = [
    {
        value: 'l1',
        label: 'San Jose',
    },
    {
        value: 'l2',
        label: 'Heredia',
    },
    {
        value: 'l3',
        label: 'Guanacaste',
    },
    {
        value: 'l4',
        label: 'Puntarenas',
    },
    {
        value: 'l5',
        label: 'Cartago',
        },
        {
        value: 'l6',
        label: 'Lim칩n',
        },
        {
        value: 'l7',
        label: 'Alajuela',
        },
    ];


    function valuetext(value) {
        return `${value}K$`;
      }

function FilterBox() {
    const [value, setValue] = React.useState([5,110 ]);
    const handleChange = (event, newValue) => {
        setValue(newValue);
      };
  return (
    <div className='filter'>
        <div>
            <div className='box-filter'>
                <div className='box-filter-row'>
                <Box
                    component="form"
                    sx={{
                        '& .MuiTextField-root': { m: 1, width: '32ch' },
                    }}
                    noValidate
                    autoComplete="off"
                    >
                <TextField
                id="outlined-select-PropType"
                select
                label="Tipo de Propiedad"
                defaultValue="Seleccionar"

                >
                {propertyTypes.map((option) => (
                    <MenuItem key={option.value} value={option.value}>
                    {option.label}
                    </MenuItem>
                ))}
                </TextField>
                <TextField
                id="outlined-select-Province"
                select
                label="Provincia"
                defaultValue="Seleccionar"

                >
                {location.map((option) => (
                    <MenuItem key={option.value} value={option.value}>
                    {option.label}
                    </MenuItem>
                ))}
                </TextField>
                <TextField
                id="outlined-select-Bedrooms"
                select
                label="Cuartos"
                defaultValue="Seleccionar"

                >
                {propertyTypes.map((option) => (
                    <MenuItem key={option.value} value={option.value}>
                    {option.label}
                    </MenuItem>
                ))}
                </TextField>
                </Box>

                </div>
                <p> Rango de Precios</p>
                <div className='box-filter-row'>

                <Box sx={{ width: 500 }}>
                <Slider
                    getAriaLabel={() => 'Temperature range'}
                    value={value}
                    onChange={handleChange}
                    valueLabelDisplay="auto"
                    getAriaValueText={valuetext}
                />
                </Box>
                </div>
                <Button buttonStyle='btn--outline'>Buscar</Button>
            </div>
        </div>
    </div>
  )
}



export default FilterBox
